### ---Помощь:
**/help** - текущее меню
**/command moderator** - получить помощь по командам модератора __(должны быть права дискорд-мода)__

### ---Основные команды:
**/anon** *[@user] [message]* - отправить анонимное сообщение пользователюв ЛС от имени бота. Пользователь не будет знать кто отправил сообщение;
**/getavatar** *[@user]* - получить ссылку на аватар упомянутого пользователя;
**/getserveravatar** - получить ссылку на аватар текущего сервера;
**/roll** *[border]* - случайное число. Если оставить значение [border] пустым, то граница по умолчанию будет 100.

### ---Музыкальные команды:
**/join voive** - присоединить бота к голосовому чату;
**/leave voice** - выкинуть бота из голосового чата;
**/play url** *[url]* *[#channel]* - запустить аудиозапись/музыку. Поддерживаются онлайн аудиозаписи, к примеру archive.org или github.io, Параметр channel не обязательный;
**/stop** - остановить аудио;
**/pause** - поставить на паузу аудио;
**/resume** - продолжить воспроизведение аудио;
**/skip** *[skip_count]* - пропустить определенное количество аудио в очереди;
**/clearqueue** - очистить очередь с аудио.

